\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"axis":{"id":"1226"},"coordinates":null,"group":null,"ticker":null},"id":"1229","type":"Grid"},{"attributes":{"days":[1,4,7,10,13,16,19,22,25,28]},"id":"1516","type":"DaysTicker"},{"attributes":{"dimensions":"width"},"id":"1235","type":"PanTool"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1060","type":"BoxAnnotation"},{"attributes":{"days":[1,8,15,22]},"id":"1517","type":"DaysTicker"},{"attributes":{},"id":"1422","type":"DatetimeTickFormatter"},{"attributes":{"child":{"id":"bk-bandwidth-worker-plot"},"title":"Bandwidth (Workers)"},"id":"1407","type":"Panel"},{"attributes":{"dimensions":"width"},"id":"1302","type":"WheelZoomTool"},{"attributes":{},"id":"1222","type":"LinearScale"},{"attributes":{},"id":"1501","type":"Selection"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1520","type":"MonthsTicker"},{"attributes":{"tools":[{"id":"1179"}]},"id":"1169","type":"Toolbar"},{"attributes":{"tools":[{"id":"1211"}]},"id":"1200","type":"Toolbar"},{"attributes":{},"id":"1444","type":"BasicTickFormatter"},{"attributes":{"months":[0,4,8]},"id":"1521","type":"MonthsTicker"},{"attributes":{},"id":"1500","type":"UnionRenderers"},{"attributes":{"axis":{"id":"1230"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1233","type":"Grid"},{"attributes":{"coordinates":null,"group":null,"render_mode":"css","source":{"id":"1214"},"text":{"field":"cpu"},"text_font_size":{"value":"1em"},"x":{"field":"x"},"x_units":"screen","y":{"field":"y"},"y_units":"screen"},"id":"1247","type":"LabelSet"},{"attributes":{},"id":"1297","type":"BasicTicker"},{"attributes":{"axis":{"id":"1048"},"coordinates":null,"group":null,"ticker":null,"visible":false},"id":"1051","t
